self.onInit = function() {
    self.ctx.map = new TbMapWidgetV2('google-map', true, self.ctx);
}

self.onDataUpdated = function() {
    self.ctx.map.update();
}

self.onLatestDataUpdated = function() {
    self.ctx.map.latestDataUpdate();
}

self.onResize = function() {
    self.ctx.map.resize();
}

self.actionSources = function() {
    return TbMapWidgetV2.actionSources();
}

self.onDestroy = function() {
    self.ctx.map.destroy();
}

self.typeParameters = function() {
    return {
        hasDataPageLink: true,
        ignoreDataUpdateOnIntervalTick: true,
        hasAdditionalLatestDataKeys: true
    };
}

